<!DOCTYPE html>
<html>
    <head>
        <meta name="ad.size" content="width=728,height=90">
        <meta charset="UTF-8">
        <style type="text/css">
            body{
                margin: 0px;
            }
            div.bannerWrapper{
                width: 100%;
                height: 250px;
                background-color: #2355D7;
                overflow: hidden;
            }
            div#banner{
                width: 880px;
                height: 250px;
                background-color: #2355D7;
                margin: 0px auto;
                display: flex;
                flex-direction: column;
                position: relative;
            }
            div#banner *{
                position: relative;
                margin: 0px;
            }
            div#banner > .logo{
                padding: 30px;
                width: 100%;
            }
            div#banner > .logo > svg{
                width: 248px;
                height: 52px;
                fill: #fff;
            }
            div#content{
                height: 100%;
                flex: 1;
            }
            div#content > .base{
                width: 100%;
                height: 100%;
                display: grid;
                padding: 0px 30px;
                grid-template-columns: 452px 1fr;
                z-index: 2;
            }
            div#content > .base > .container .p{
                animation: 7s cubic-bezier(0.28, 0, 0.18, 1) 1s fade forwards;
                opacity: 0;
            }
            div#content > .base > .container .h{
                animation: 8s cubic-bezier(0.28, 0, 0.18, 1) 0s fade forwards;
                opacity: 0;
            }
            div#content > .base > .container .t{
                position: absolute;
                top: 58px;
                left: 138px;
                animation: 6.5s cubic-bezier(0.445, 0.05, 0.55, 0.95) 1.5s fade forwards;
                opacity: 0;
            }
            div#content > .base > .container > img{
                position: absolute;
                bottom: 0px;
                animation: 7.5s cubic-bezier(0.445, 0.05, 0.55, 0.95) 0.5s fade forwards;
                opacity: 0;
                z-index: 2;
            }
            div#content > .base > .container > .p1{
                position: absolute;
                bottom: -60px;
                width: 312px;
                height: 312px;
                background-color: #fff;
                z-index: 0;
                filter: blur(32px);
                opacity: 0.7;
                border-radius: 100%;
                animation: 7s cubic-bezier(0.445, 0.05, 0.55, 0.95) 1s fade forwards;
                opacity: 0;
            }
            div#content > .g{
                width: 100%;
                height: 100%;
                padding: 0px 30px;
                z-index: 2;
            }
            div#content > .g > p{
                margin: 0px;
                animation: 8s cubic-bezier(0.445, 0.05, 0.55, 0.95) 0s fade forwards;
            }

            @keyframes fade{
                0%{
                    opacity:0;
                }
                25%{
                    opacity: 1;
                }
                75%{
                    opacity:1;
                }
                100%{
                    opacity: 0;
                }
            }
        </style>

                    //Render contents
                    document.getElementById("content").innerHTML = "";

                    //Make slider wrapper
                    setTimeout(renderSlide,slides[slide]?.renderIn||0,slides[slide],document.getElementById("content"));

                        for(var name in contents.attrs){

                    (contents?.childs||[]).map((child)=>{

                    });
                    parent.appendChild(node);
